import React from "react";
import FormIcon from "../assets/images/dynamic_form-white-48dp.svg";
import DashIcon from "../assets/images/dashboard-white-48dp.svg";
import Col from "react-bootstrap/Col";
import { Link } from "react-router-dom";
import { MDBNav, MDBNavItem, MDBNavLink } from "mdbreact";

const SideBar = () => {
  const sideBarStyle = {
    top: 0,
    left: 0,
    width: "5rem",
    height: "100vh",
    backgroundColor: "black",
    borderRight: "1px solid white",
    alignContent: "center",
    display: "flex",
  };

  let sideBarIconStyle = {
    width: "2rem",
    height: "2rem",
    alignSelf: "center",
  };

  return (
    <div className="Side-bar" style={sideBarStyle}>
      <div style={{height: "33%"}}>
        <MDBNav>
          <MDBNavItem>
            <MDBNavLink active to="/"> <img src={DashIcon} style={sideBarIconStyle} alt="dashboard"></img></MDBNavLink>
          </MDBNavItem>
          <MDBNavItem>
            <MDBNavLink to="/damage-defect-form"><img src={FormIcon} style={sideBarIconStyle} alt="forms"></img></MDBNavLink>
          </MDBNavItem>
        </MDBNav>
      </div>
    </div>
  );
};

export default SideBar;
